    if reversed_string == reversed_string[::-1]:
        palindromes = [reversed_string]
    else:
        palindromes = []
    palindromes.extend(find_palindromes(s, start + 1, end, memo))
    palindromes.extend(find_palindromes(s, start, end - 1, memo))
    memo[start, end] = palindromes
    return palindromes

